import 'package:library_reservation/core/model/dic_data_entity.dart';dicDataEntityFromJson(DicDataEntity data, Map<String, dynamic> json) {	if (json['dicCode'] != null) {		data.dicCode = json['dicCode'].toString();	}	if (json['dicName'] != null) {		data.dicName = json['dicName'].toString();	}	if (json['dicValue'] != null) {		data.dicValue = json['dicValue'].toString();	}	if (json['type'] != null) {		data.type = json['type'] is String				? int.tryParse(json['type'])				: json['type'].toInt();	}	if (json['picUrl'] != null) {		data.picUrl = json['picUrl'].toString();	}	if (json['version'] != null) {		data.version = json['version'].toString();	}	if (json['typeCode'] != null) {		data.typeCode = json['typeCode'].toString();	}	if (json['sortNo'] != null) {		data.sortNo = json['sortNo'] is String				? int.tryParse(json['sortNo'])				: json['sortNo'].toInt();	}	return data;}Map<String, dynamic> dicDataEntityToJson(DicDataEntity entity) {	final Map<String, dynamic> data = new Map<String, dynamic>();	data['dicCode'] = entity.dicCode;	data['dicName'] = entity.dicName;	data['dicValue'] = entity.dicValue;	data['type'] = entity.type;	data['picUrl'] = entity.picUrl;	data['version'] = entity.version;	data['typeCode'] = entity.typeCode;	data['sortNo'] = entity.sortNo;	return data;}